INSERT INTO `achievements` (`id`, `titleImg`, `Title`, `Description`, `Date`, `created_at`, `updated_at`) VALUES
(1, 'erc.jpg', 'Attaining 27th position in the European Rover Challenge (ERC) - 2018', 'Being the first mars rover team of AUST our team AUST Little Step has taken its first little step with the help of Almighty Allah. Having so many complications and our semester final we have manage to attend the European Rover Challenge (ERC) - 2018 and attain 27th position among 65 teams in the world. It is a small step for a team but a bigger step towards our goal. We are really thankful to our team that stayed behind and worked tirelessly so that this team could stand. Special thanks to Jubayer Hossain sir for being with us throughout the whole competition and provide us the right guide lines and thanks to Azmyin Md Kamal sir for inspiring us to do better always and his support in both physical and mentally. And really thankful to all our mentors and supervisors without them the project was incomplete. Pray for us so that we can overcome our future challenges.', '2018-11-01', NULL, NULL),
(2, 'erc2.jpg', 'Aust Little Step\r\nRover Challange Group has shown magnificent performance', 'আসসালামুয়ালাইকুম, ভাইয়া / আপু |\r<br />আগামী ১৪-১৬, সেপ্টেম্বর তারিখ AUST Little Step অংশগ্রহণ করতে যাচ্ছে European Rover Challenge - 2018, Poland এ। যেখানে AUST Little Step কে Final Round এ লড়াই করতে হবে বিশ্বের শীর্ষ ৫০ টি টীমের সাথে | কিন্তু টিম AUST Little Step এত অল্প সময়ের মধ্যে Poland এ অংশগ্রহণের জন্য প্রয়োজনীয় অর্থ সংগ্রহ করতে যথেষ্ট হিমশিম খাচ্ছে। যার ফলে তাদের মূল কিছু সদস্যের Competition এ যাওয়া অসম্ভব হয়ে যাচ্ছে শুধুমাত্র আর্থিক সংকটে যাদের অংশগ্রহন ছাড়া Rover টি চালানো বেশ কঠিন। তাদের পারিবারিক সচ্ছলতাও নেই।\r<br />\r<br />আমাদের বিশ্ববিদ্যালয় কর্তৃপক্ষ AUST Little Step এর জন্য যথাসাধ্য সহায়তা করেছে এবং করছেন, মূল পর্বে অংশগ্রহণের জন্য।\r<br />\r<br />বিশ্ববিদ্যালয়ের সহযোগিতায় গত ৯-১০ মাসে Mars Rover টি তৈরী করা হয়েছে।শুধু এখন তাদের প্রতিযোগিতায় যাওয়ার অপেক্ষা।\r<br />\r<br />Semester Final পরীক্ষার চলাকালীন সময় প্রতিযোগিতাটা হওয়া সত্ত্বেও টিমটি তাদের স্বপ্নে অনড় থেকে অংশগ্রহন করতে যাচ্ছে ERC-2018 এ।বাঁধা হয়ে দাড়িয়েছে শুধু যাতায়াত খরচ। তাই তারা তাদের এতগুলো মাসের পরিশ্রমটাকে শুধু বিফলে যেতে দিতে চাচ্ছেনা |\r<br />\r<br />তাই শ্রদ্ধেয় Alumni ভাইয়া ও আপুদের দৃষ্টি আকর্ষণ করছি, যেন তারা AUST Little Step এর সহযোগিতায় Officially বা Personally এগিয়ে আসেন। আপনাদের যেকোন ছোট সহায়তাই টিমটির জন্য অনেক বড় কিছু |\r<br />\r<br />তাহলে হয়তো আপনাদের এই উপকারটি AUST এর ইতিহাসে বয়ে নিয়ে আসতে পারে আগামীর আরো হাজারো স্বপ্নচারীদের।\r<br />ধন্যবাদ |', '2018-11-02', NULL, NULL),
(3, 'concepta.jpg', 'প্রকৌশলের পড়াশোনা অনলাইনে, বাংলায়', 'কনসেপ্টা ৭১। নামের সঙ্গে ৭১ থাকলেও যাত্রা শুরু হয়েছে ২০১৭ সালে। ২২ জন সদস্য নিয়ে গড়ে তোলা এ দলটি কাজ করে অনলাইনে। ঘরে বসেই যেন ছেলেমেয়েরা প্রকৌশল সম্পর্কে জানতে পারে, শিখতে পারে, কনসেপ্টা ৭১ তৈরি করেছে সেই মঞ্চ।\r<br />নির্দিষ্ট কোনো অফিস বা স্টুডিও নেই। অলাভজনক এই প্রতিষ্ঠানের সদস্যরা সবাই প্রকৌশলী বা প্রকৌশলের ছাত্র। যে যাঁর বাসায় বসেই এ–সংক্রান্ত টিউটোরিয়াল তৈরি করে ইউটিউব চ্যানেলে আপলোড করেন। প্রতিষ্ঠাতা খান আবিদ আহসান বলেন, ‘দলের সদস্যদের অক্লান্ত পরিশ্রমে বাংলা ভাষায় গড়ে উঠেছে আজকের এই অনলাইন ইঞ্জিনিয়ারিং লার্নিং সেন্টার।’ কনসেপ্টা ৭১ মূলত বিএসসি ও ডিপ্লোমা কোর্সের ছাত্রছাত্রীদের জন্য টিউটোরিয়াল তৈরি করে নিজস্ব ইউটিউব চ্যানেলে আপলোড করে। তবে যাঁরা চাকরি করছেন বা প্রকৌশল সম্পর্কে জানার আগ্রহ আছে, ভিডিও দেখে শিখতে পারবেন তাঁরাও। কনসেপ্টা ৭১ দলটির বিশ্বাস, বিনোদনের পাশাপাশি ইউটিউবকে সচেতনতা তৈরি ও শিক্ষার উপকরণ হিসেবে তুলে ধরার এখনই উপযুক্ত সময়। শুরুতে পুরকৌশলের বিভিন্ন বিষয় দিয়ে শুরু করলেও এখন যন্ত্রকৌশল–সংক্রান্ত নানা ভিডিও জায়গা করে নিচ্ছে তাঁদের চ্যানেলে।\r<br />কনসেপ্টা ৭১–এর সবাই আহ্ছানউল্লা বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ের শিক্ষার্থী। তাঁদের মধ্যে তিনজন যন্ত্রকৌশলে পড়েছেন। বাকিরা পুরকৌশলের ছাত্র। প্রতিষ্ঠাতা খান আবিদ আহসান বিশ্ববিদ্যালয়ের পুরকৌশল বিভাগ থেকে এ বছর স্নাতক শেষ করলেন। সিজিপিএ ৩.৯২ পেয়ে বিভাগে তাঁর অবস্থান সবার ওপরে। সহপ্রতিষ্ঠাতা ফারহান ফাহাদ ইউরোপিয়ান ইউনিভার্সিটি অব বাংলাদেশের পুরকৌশল বিভাগের প্রভাষক। নামটা কেন কনসেপ্টা ৭১ হলো, ব্যাখ্যা করলেন আবিদ। ‘ইংরেজি কনসেপ্ট থেকে কনসেপ্টা শব্দটা এসেছে। কনসেপ্ট অর্থ হলো ধারণা। যেহেতু চ্যানেলটির মূল লক্ষ্য ছাত্রছাত্রীদের প্রকৌশলবিষয়ক বিভিন্ন ধারণা পরিষ্কারভাবে তুলে ধরা, তাই এই নামকরণ। বাংলাদেশি ছাত্রছাত্রীদের জন্য বাংলা ভাষায় টিউটোরিয়ালগুলো তৈরি করা হচ্ছে। এ দেশের জন্য ১৯৭১ সালটি খুবই তাৎপর্যপূর্ণ, তাই স্বাধীনতাকে স্মরণ করে কনসেপ্টার সঙ্গে ৭১ যোগ করা হয়েছে।’\r<br />মূলত ইউটিউব চ্যানেল হলেও ফেসবুক পেজ ও গ্রুপও রয়েছে কনসেপ্টা ৭১-এর। কোনো টিউটোরিয়াল বুঝতে কারও সমস্যা হলে, তাৎক্ষণিক সমাধানও মিলবে এই ফেসবুক পেজ থেকে। এ ছাড়া চ্যানেলের যেকোনো আপডেট যেমন—কবে কোন টিউটোরিয়াল আপলোড করা হবে, সে–সংক্রান্ত পোস্ট পাওয়া যায় ফেসবুক পেজে। এখন ইউটিউবে তাঁদের সাবস্ক্রাইবারের সংখ্যা ৬ হাজারের বেশি। ২৭৮টি টিউটোরিয়াল আপলোড করা হয়েছে, ভিডিওগুলো দেখা হয়েছে মোট ৪ লাখের বেশি বার।\r<br />কনসেপ্টা ৭১ ভবিষ্যতে পুরকৌশল ও যন্ত্রকৌশলের পাশাপাশি প্রকৌশলের অন্যান্য বিভাগ নিয়েও কাজ করতে আগ্রহী। অন্য বিভাগের ছাত্রছাত্রীদের এগিয়ে আসার জন্য আহ্বান জানিয়েছেন তাঁরা।', '2018-11-18', NULL, NULL);

