(2, 0, 'Syndicate meeting of Aust ', '', '2018-10-24', 'yes', 'announcement', 'syndicate.jpg', 'The 57th meeting of the Syndicate of Ahsanullah University of Science and Technology (AUST) was held on 21st October\'18 at the AUST Meeting Room. The meeting was presided over by the Chairman of Syndicate and Vice-Chancellor of AUST, Professor Dr. A.M.M Safiullah,\r\n<br />\r\n<br />Syndicate members Prof. Dr. Kazi Shariful Alam, Pro Vice-Chancellor (in charge) and Treasurer, AUST, Prof Dr. M. Kaykobad, Professor, Department of CSE, BUET, Prof. Dr. Abdur Rahim Mollah, Dean, Faculty of Engineering, AUST, Prof. Dr. Md. Amanullah, Dean, Faculty of Business and Social Sciences, AUST, Dr. M. Ehsanur Rahman, Executive Director, DAM, Prof. Dr. Sharif Enamul Kabir, Department of Chemistry, Jahangirnagar University, Mr. Shibbir Mahmud, Chairman, Swiss Tex Group and Mr. Muhammad Abdul Gafur, Member-Secretary of the Syndicate of AUST were present.', NULL, NULL),
