INSERT INTO `austlives` (`id`, `updated_at`, `created_at`, `title`, `name`, `story`, `image`) VALUES
(2, '2018-12-06 13:51:11', '2018-12-06 13:51:11', 'A day in the life of a university of AUST', 'Sristy Mahboob', 'The one thing I can say with certainty about life as a student is that there is no typical day. A first year’s day will be completely different from a third year’s, a classicist’s different from a chemist’s. Every day is different. But here is a brief taster of what a typical day is like for me, as a linguistics student at the University of York. \r\n\r\nMorning has broken – unfortunately\r\n\r\nI confess, the hour at which my morning breaks is somewhat dependent on the previous night’s activities. In first year, my day typically began at 8.45am. I would pull on my jeans over my pyjamas, grab a bacon sandwich for breakfast and arrive at my lecture at 8.59am, clutching pen, paper and the crumbled remains of the aforementioned bacon roll.\r\n\r\nBy third year, my mornings resemble some kind of cereal advert. Portioning roasted vegetable couscous into a Tupperware pot, I eat a bowl of granola and yoghurt, before strolling to campus, fresh-faced and ready to start learning. At least, that’s what I look like in my head.', 'bg_img_2.jpg');

