INSERT INTO `departments` (`id`, `deptName`, `deptshortName`, `aboutDept`, `created_at`, `updated_at`) VALUES
(0, 'All', 'All', '', '2018-11-06 18:00:00', '2018-11-06 18:00:00'),
(1, 'Architecture ', 'ARCH', 'Our Program:\r\n\r\nThe Bachelor of Architecture (B.Arch.) program of the Department of Architecture involves a wide range of disciplines in the fields of arts, sciences and engineering. The diversified theoretical courses are aimed at developing an understanding of the bases of architectural design problems. The studio sessions are then available for application of these knowledge and understandings to practical design problems. Thus, design studio works constitute a very important aspect of the B. Arch. program and continues from Design Studios I & II in the first year to Design Studios IX-X in the fifth or final year.\r\n\r\n \r\n\r\nThe Jury System:\r\n\r\nAll significant studio projects of the students, particularly those of the higher levels including the final year terminal projects are evaluated by the �Jury� system. Under this system, a jury of external examiners comprising of the faculty members as well as at least one or two well known architects from the profession is constituted to listen to the presentation of the students, deliberate with them and pass judgment on the standard and quality of the work presented. The students are graded largely on the basis of such open jury evaluations.\r\n\r\n \r\n\r\nWe already have:\r\n\r\nThe Department already has established departmental computer lab, photography lab and materials lab. The computer lab is equipped with computer networking, advanced software packages and internet connection. The students use the lab quite extensively. The students also use the photography lab under the photography course run by the department.', '2018-11-02 18:00:00', '2018-11-02 18:00:00'),
(2, 'School of Business', 'SoB', 'The School of Business started its journey along with other departments of the University in 1995. This department was the sole department under the Faculty of Business and Social Science. The University has intention to open some other disciplines under this faculty if found demanding.\r\n\r\nThe School of Business is offering 4-years BBA degree, since its, very inception, which is divided into eight semesters. The syllabus and teaching method had been updated over the passage of time so that those could meet the demand of the future business executives. Internship program is included in this program so that the students can acquire practical knowledge of the real work environment. Five full-time teachers, of those two having Ph.D. degree, along with part-time teachers are constantly trying to give the best to the students. Part-time teachers are chosen on the basis of the merit of the course and the needed and required expertise. The courses selected for the BBA program are a unique assortment of varied disciplines so that they can meet the challenges of the 21st century. Computer laboratory facility is available for BBA students to make them acquainted with this modern technology.\r\n\r\nNowadays business education is not complete if it is not blended with practical exposure to the necessary theoretical part. For this purpose students are sent to different enterprises/factories for acquiring first hand knowledge where they will be working in future. Moreover, guest lectures and seminars are arranged to share the high expertise possessed by the reputed and competent resource persons.\r\n\r\nIn the absence of recreation facilities, education life becomes bored and monotonous; hence yearly orientation & reception for the new comers and farewell ceremonies for the outgoing students, coupled with cultural functions are arranged. Side by side students, under the leadership of some teachers, often join picnics and pleasure tours.\r\n\r\nMBA Program (both regular and executive) had been launched with the existing 4-year BBA Program in February, 2002. The launching ceremony was held at Ahsania Mission Auditorium on February 1, 2002. Mr. Barkat Ullah Bulu, Honourable State Minister of Commerce, Government of the People\'s Republic of Bangladesh attended the ceremony as the Chief Guest along with other distinguished guests.', '2018-11-02 18:00:00', '2018-11-02 18:00:00'),
(3, 'Civil Engineering', 'CE', 'The Department of Civil Engineering was established in 1995. The total enrolment in the 4-year B.Sc. program is over 1000.\r\n\r\nThere are now thirty seven (37) full-time faculty members including eight (8) Professors. Moreover, thirteen (13) faculty members are on higher study leave. In addition, there are two (2) part-time faculty members.\r\n\r\nThe Department of Civil Engineering has established eight (8) laboratories with sophisticated equipment on the university campus.\r\n\r\nThe main aim and objectives of this department is to offer program covering all important branches and disciplines of Civil Engineering. The department covers a wide range of course curriculum and well-equipped laboratory facilities.  The B.Sc. degree offered by the Department of Civil Engineering at AUST has been officially recognized by the Institution of Engineers, Bangladesh (IEB). Since the inception of the Civil Engineering Department, more than thirty (30) batches have graduated with Bachelor\'s Degree. A number of Graduates of this department are pursuing higher studies in Bangladesh University of Engineering and Technology (BUET) as well as in different countries of the world. Some of them are working in the reputed consulting and construction firms of the Country. Several graduates have already got Ph.D. and M. Sc. degrees from universities of different countries and are working abroad.\r\n\r\nThe Department is actively involved in the activities of the national and international engineering professional bodies. Apart from the academic programs, the department organizes the comprehensive training on computer aided design, drawing and project management through Centre for Extension Service of the University. Moreover the department is planning to offer materials testing and consulting services by using its laboratories equipped with highly sophisticated and modern equipments and highly qualified and experienced faculty members. The Department arranges field visit, study tour, seminars, and programs on extracurricular activities.', '2018-11-03 18:00:00', '2018-11-03 18:00:00'),
(4, 'Computer Science and Engineering', 'CSE', 'The department of Computer Science and Engineering, abbreviated CSE, is offering an undergraduate engineering degree program since the establishment of the university in the year 1995 with a view to offer quality higher education to numerous worthy young fellows as well as to meet the huge demand of highly qualified specialists in the field. The program follows an intensive course curriculum containing well-organized courses on basic sciences, computer science, electrical and electronic engineering, computer engineering, management and humanities. Computer science and engineering courses constitute the bulk of the program (about 70%) and are most emphasized, of course. \r\n\r\nUsual intake of students in the department is twice in an year. Students graduated from this department are employed in different prestigious institutions and organizations home and abroad. A good number of our graduates have completed postgraduate programs including doctoral programs with brilliant performances at highly ranked universities around the world.\r\n\r\nThe department has a good number of young full-time faculty members with best available exposure to ever-growing horizon of computer science and engineering. Besides, a number of part-time faculties also teach in each semester from other universities, research organizations and industrial establishments for extending experience-rich education.\r\n\r\nThe department organizes various co-curricular and extra-curricular activities to develop important social and professional faculties in the students. Most common co-curricular activity is the programming contest, which has become regular by this time. And the most common extra-curricular activities are reception parties for welcoming the newly entered students and for biding farewell to the outgoing students.\r\n\r\nThe department has developed its own laboratories which include six computer labs and one digital electronics lab equipped with modern personal computers and electronic devices. There is a server center attached to the department which is equipped with various PC-server systems for providing network facilities to the labs and offices all over the university campus.', '2018-11-03 18:00:00', '2018-11-03 18:00:00'),
(5, 'Electrical & Electronic Engineering', 'EEE', 'Undergraduate program is accredited by professional bodies such as UGC, IEB (The Institute of Engineers, Bangladesh), IAE, BUET etc. The department of  EEE (Electrical & Electronic Engineering) is nationally and internationally recognized by its contribution to different fields of Electrical & Electronic Engineering. The graduates of this department have gone on to a variety of positions in industry such as Siemens Bangladesh, Ericsson, Grameen Phone, Robi, Banglalink, Airtel, Government services, PGCB GETCO etc. Many students of EEE department successfully transferred credit to many renowned American & Australian Universities. At present some graduates of  EEE department are doing their postgraduate degrees in Canada, Germany, UK, US & Australia.\r\n\r\nAt present there are 45 full time teachers of the department together with a few part time teachers. Part time teachers are mostly the senior teachers of BUET (Bangladesh University of Engineering and Technology)\r\n\r\n The Electrical & Electronic Engineering program is interdisciplinary. It requires a blend of knowledge from the areas of Electrical Engineering, Control Engineering, Electronics, Computer Science, and Telecommunication Engineering. Students in Electrical Engineering are given an opportunity to learn and extend their abilities to analyze and solve complex problems and to design new uses of technology to serve today�s society. This engineering program provides an integrated educational experience directed toward the development of the ability to apply pertinent knowledge to the identification and solution of practical problems in electrical, electronic and telecommunications engineering. This program also insures that the design experience is developed and integrated throughout the curriculum in a sequential development leading to advanced work and includes both analytical and experimental studies.', '2018-11-03 18:00:00', '2018-11-03 18:00:00'),
(6, 'Textile Engineering', 'TE', 'Textile and clothing industry is the single source of growth in Bangladesh\'s rapidly developing economy. Exports of textile and garments are the principal source of foreign exchange earnings. In the financial year 2016-2017, the RMG sector generated USD 28.14 billion which was 80.7% of the total earnings in exports and 12.36% of GDP. It is anticipated that garment export will be doubled in the coming 10 years. Currently, textile industry accounts for 45% of all industrial employment in the country.\r\n\r\n \r\n\r\nThe Ahsanullah University of Science and Technology (AUST) was the first private university in Bangladesh to introduce B.Sc. in Textile Technology course in 1998.The program aimed at turning out textile specialists and serving mainly textile industry. In fall 2011 semester, University Grants Commission (UGC) approved naming our bachelor degree as B.Sc. in Textile Engineering. At present the department has around one thousand students. More than 1800 students of 27 batches have already graduated from this department; and the graduates are performing with reputation in many textile and apparel industries, commercial organizations such as bank, buying houses, sourcing, testing and certification companies as well as in different universities as faculty members. A notable number of our graduates are also enrolled in reputed foreign universities for post-graduate study and research. Some graduate have already obtained master\'s and PhD degrees from different recognized universities.\r\n\r\n \r\n\r\nFrom the very beginning of establishment we have been putting our best efforts to enrich the Department of Textile Engineering of AUST with modern laboratory facilities. Over the years, we have set up yarn manufacturing (spinning), fabric manufacturing (weaving and knitting), wet processing (dyeing, printing and finishing), apparel manufacturing, textile testing, and computer laboratories. At the same time, we maintain close and collaborative relationships with the textile and apparel industries and various research institutes for executing our academic programs and providing practical education to the students. Seminars and mill visits are organized on regular basis to update the students and the faculty members with latest technological developments. Towards the end of 4-year degree course, we arrange for our students an 8-week-long industrial training to bridge the gap between the academia and the industry. This helps the students develop skills and competencies they require to be ready for industry.\r\n\r\n \r\n\r\nAt present the department has 27 full-time faculty members; a handsome number of whom have excellent industrial experience with postgraduate degrees from different reputed Asian and European universities. Besides, many distinguished faculty members from country\'s top public universities and experts from reputed textile industries and research institutes are teaching regularly as invited lecturers. Recently the department has taken initiative for IEB (Institute of Engineers, Bangladesh) accreditation of the offered undergraduate program. Very recently a project submitted by the department, titled \"Introducing Sustainability to the textile engineering curriculum in Bangladesh\" has been officially selected for funding under the window of collaboration between AUST (Ahsanullah University of Science and Technology) and TUD (Technical University of Dresden) by the DAAD (German Academic Exchange Service) authority.', '2018-11-03 18:00:00', '2018-11-03 18:00:00'),
(7, 'Mechanical and Production Engineering', 'ME', 'Department of Mechanical and Production Engineering has formally started its journey on Spring Semester-2010 at Ahsanullah University of Science and Technology. Our mission is to educate persons for professional and technical excellence, to perform research to advance the science and practice of engineering, to engage in service activities that advance the department, the university and the profession, and to instill in ourselves and students habits and attitudes that promote ethical behavior, professional responsibility and careers that advance the well-being of society. The department offers two undergraduate degree programs: Bachelor of Science in Industrial and Production Engineering (B.Sc. in IPE) and Bachelor of Science in Mechanical Engineering (B.Sc. in ME).\r\n\r\nIndustrial Engineering is where engineering meets business. It is the perfect career for people who like to solve practical problems in a variety of working environments and develop systems to improve quality and productivity. Mechanical engineers are trained in traditional fields such as fluid mechanics, heat transfer, machine design, and controls; but they also learn how to apply the fundamental principles of physics, chemistry and mathematics.\r\n\r\nWe are in an enviable position of continuing growth and rejuvenation. The department continues to search for young, promising researchers to enrich its academic staff and promote its exciting research vision. Part of that process entails expanding vertically by improving the foundation of its unique laboratory facilities, designing its educational programs for tomorrow\'s challenges, contributing to national endeavors.', '2018-11-03 18:00:00', '2018-11-03 18:00:00'),
(8, 'Arts and Sciences', 'AS', '', '2018-11-03 18:00:00', '2018-11-03 18:00:00');

