(1, 'Bappi Premier League', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.', 'https://www.facebook.com/events/713321712362522/714681445559882', 'event', 'yes', NULL, NULL),
(2, 'Milad Mahfil', 'Mehfil (also spelled mahfil) is an evening of courtly entertainment poetry or concert of Indian classical music and Pakistani classical music (particularly Hindustani classical music) and dance, performed for a small audience in an intimate setting.\r<br />\r<br />Historically, mehfils were presented in the homes or palaces of Muslim royalty or noblemen, who acted as these artists\' patrons.[1] Mehfils are also an integral part of the Hyderabadi Muslim community, and used as a way of unity among them, all around the world.[2]\r<br />\r<br />Today they are generally held in the homes of especially avid music lovers or the lovers of poetry-recitation gatherings. Ghazals are a common genre performed at mehfils. Ghazal recitation gatherings are called \'Mehfil-e-Mushaira\' in the Urdu language.', 'N/A', 'event', 'yes', NULL, NULL),
(3, '10th Convocation', '10th Convocation of AUST is going to be held on 09 January 2018 at Bangabandhu International Conference Centre, Sher-e-Bangla Nagar, Dhaka. All graduates of B.Sc. in Engineering (CE, CSE, EEE, IPE, ME and TT/TE), B. Arch, BBA, MBA, EMBA, M.Sc. (Math.) and M.Ed. programs of Spring 2016 and Fall 2016 semesters are advised to register their names by depositing Tk. 5,500.00 per person for participation in the Convocation within 24 December 2017.', 'www.btf-reg.org', 'convocation', 'yes', NULL, NULL),
(4, 'Hult Priza at Aust ', 'We are very excited to announce that HULT PRIZE at AUST has made an official collaboration with Ahsanullah University of Science & Technology Debating Club for the event, Hult Prize OnCampus Program 2019.\r<br />\r<br />We want to thank and congratulate the members of Hult Prize at AUST Organizing Committee and AUST Debating Club to make this pact happen. Together we are going to host the \"First International\" Competition at AUST.', 'www.hultprizeat.com/austbd', 'event', 'yes', NULL, NULL),
(5, 'Mind Spark\'18 ', 'All the tech enthusiasts out there! Get ready with your pen because here\'s your chance to showcase your talent by sparking up your minds. For the first time in the history of Ahsanullah University of Science and Technology, AUSTIDC, under MindSparks 18 in association with Cognizance, IIT Roorkee, will publish its first official magazine entitled as the \"Neuron\". The Neuron will cover articles on various diverse topics such as,\r<br />1. Robotics\r<br />2. Micro Controller\r<br />3. Sci-fi\r<br />4. Tech based comic\r<br />5. Inspirational Personalities \r<br />6. Renewable energy\r<br />7. Bangladesh in 2100\r<br />8. Internet of Things (IoT)\r<br />9. Artificial Intelligence (AI)\r<br />10. Drone\r<br />11. Machine learning \r<br />12. Entrepreneurship \r<br />\r<br />Besides, writings apart from these topics are encouraged to be submitted. \r<br />\r<br />So, what are you waiting for? Grab this chance and share your ideas by sending your articles to neuron.austidc@gmail.com\r<br />\r<br />The selected articles will be published on our facebook page as well.\r<br />\r<br />Restriction of words from 450 to 500 words.\r<br />\r<br />Last date of submission is 20th of November. For more information, keep an eye on our page', 'https://www.facebook.com/events/462610940873980', 'event', 'yes', NULL, NULL),
(6, 'BUP ICT FEST 2018', 'All kind of information are in registration link web site.', 'https://www.facebook.com/BUPITC/posts/297357010878065', 'event', 'yes', NULL, NULL),
(7, 'Imagine cup 2019', 'Topic:- \r<br />Imagine Cup 2019\r<br />\r<br />Imagine Cup is a global competition that empowers the next generation of computer science students to team up and use their creativity, passion and knowledge of technology to create applications that shape how we live, work and play. Every year tens of thousands of students from across the globe compete for cash, travel and prizes and for the honor of taking home the Imagine Cup!\r<br />\r<br />The event will be broadcast via youtube Live.\r<br />Broadcast link: https://bit.ly/2QlQdDT\r<br />\r<br />Organized by: Microsoft Technical Community - Bangladesh\r<br />Date: 17 September 2018 Saturday 10:00 PM - 11:00 PM\r<br />\r<br />Speaker:\r<br />1. M. A. Nakib Juris, Field Technical Manager (SAM&C) at Microsoft\r<br />Topic: Imagine Cup 2019 \r<br />Language: Bangla (বাংলা)\r<br />\r<br />Organizing Committee\r<br />Convenor: Zubayer Al Billal Khan\r<br />Coordinator : Md Aftab Uddin Kajal \r<br />Member:\r<br />Ratan Sunder Parai\r<br />Konika Ferdous\r<br />Solaiman Shohag\r<br />Rasedur Rahman Roxy\r<br />Mahfuza Humayra Mohona\r<br />Sabrina Yeasmin Setu\r<br />Arika Afrin Boshra', 'n/A', 'event', 'yes', NULL, NULL),
(8, 'ACI Motors Presents Ignition 2018', '***** TOTAL PRIZE MONEY BDT 270K+***** <br>\r<br />We are very much impassioned to announce that this year, for the first time, Department of Mechanical Engineering, KUET is going to organize the biggest<br> Mechanical Festival of the country – “ ACI Motors Presents IGNITION 2018- LET IGNITE YOUR POTENTIAL POWERED BY LOVELLO ICE CREAM”\r<br /><br />“ACI Motors Presents IGNITION 2018 POWERED BY LOVELLO ICE CREAM” seeks the best of the best from the areas of Science, Engineering & Technology to inspire and engage students to inflame their creativity. “IGNITION 2018” aims students to create solutions to real-world problems bringing enthusiastic minds together to collaborate their ideas. <br>\r<br /><br />“ACI Limited presents IGNITION 2018” will consist of total 10 competitions – <br>\r<br /><br />1.	Line Follower Race <br>\r<br /><br />Prize Money: 90,000 BDT <br>\r<br /><br />Rule Book: https://goo.gl/1NejFh <br>\r<br /><br />\r<br /><br />2.	Project Competition <br>\r<br /><br />Prize Money: 45,000 BDT\r<br /><br />Rule Book: https://goo.gl/ig61y2\r<br /><br />\r<br /><br />3.	Management Case Study\r<br /><br />Prize Money: 50,000 BDT\r<br /><br />Rule Book: https://goo.gl/1kX4Rb\r<br /><br />\r<br /><br />4.	CAD Contest\r<br /><br />Prize Money: 24,000 BDT\r<br /><br />Rule Book: https://goo.gl/8cKwUx\r<br /><br />\r<br /><br />5.	Gaming Contest\r<br /><br />Prize Money: 20,000 BDT\r<br /><br />Rule Book: https://goo.gl/Xxmiky\r<br /><br />\r<br /><br />6.	Poster Presentation\r<br /><br />Prize Money: 15,000 BDT\r<br /><br />Rule Book: https://goo.gl/oNgEHs\r<br /><br />\r<br /><br />7.	Programming Contest\r<br /><br />Prize Money: 15,000 BDT\r<br /><br />Rule Book: https://goo.gl/dvLpSS\r<br /><br />\r<br /><br />8.	Matlab Contest\r<br /><br />Prize Money: 10,000 BDT\r<br /><br />Rule Book: https://goo.gl/nx62Z3\r<br /><br />\r<br /><br />9.	Mechanics Olympiad\r<br /><br />Prize Money: 6,000 BDT\r<br /><br />Rule Book: https://goo.gl/VYf585\r<br /><br />\r<br /><br />10.	PLC (Programmable Logic Controller) Contest\r<br /><br />Prize Money: 6,000 BDT\r<br /><br />Rule Book: https://goo.gl/cWRTDM\r<br /><br />\r<br /><br />\r<br /><br />****Registration link: https://goo.gl/Adbhoi ****\r<br /><br />****Last Date of registration: 25 August, 2018****\r<br /><br />\r<br /><br />\r<br /><br />Event Schedule:\r<br /><br />September 6 – Seminar on Mechanical Job Sectors(For Mechanical Engineering students)\r<br /><br />September 7 – Will be updated soon.\r<br /><br />September 8 – Will be updated soon.\r<br /><br />\r<br /><br />\r<br /><br />**Souvenir kit, Certificate, T-shirt, Breakfast, and Lunch will be provided to the participants.\r<br /><br />**\r<br /><br />\r<br /><br />Get connected with the event to get all the updates.\r<br /><br />\r<br /><br />For any Enquiry :\r<br /><br />\r<br /><br />Antor : +88 01521 439 373\r<br /><br />Mahi : +88 01878 873 809\r<br /><br />Rana: +88 01521 495 880\r<br /><br />Sumit: +88 01964 158 014\r<br /><br />Rafiu: +88 01521 334 452', 'https://goo.gl/Adbhoi', 'event', 'yes', NULL, NULL),
(9, 'ন্যাশনাল গার্লস প্রোগ্রামিং কন্টেস্ট ২০১৮ ( Ngpc 2018)', 'ন্যাশনাল গার্লস প্রোগ্রামিং কন্টেস্ট – ২০১৮ প্রাইমারী, মাধ্যমিক, উচ্চ মাধ্যমিক এবং বিশ্ববিদ্যালয়ে অধ্যয়নরত ছাত্রীদের জন্য একটি প্রোগ্রামিং প্রতিযোগিতা । প্রতিযোগিতাটি ACM ইন্টারন্যাশনাল কলেজিয়েট প্রোগ্রামিং কনটেস্ট (আইসিপিসি) এর নিয়ম অনুযায়ী অনুষ্ঠিত হবে।\r<br />ড্যাফোডিল ইন্টারন্যাশনাল ইউনিভার্সিটির কম্পিউটার বিজ্ঞান ও প্রকৌশল বিভাগ, বাংলাদেশ কম্পিউটার কাউন্সিল এবং টেকওয়ার্ল্ড বাংলাদেশ এর সহযোগিতায় এবং ডাক, টেলিযোগাযোগ ও তথ্য প্রযুক্তি বিষয়ক মন্ত্রণালয়ের তত্ত্বাবধায়নে ন্যাশনাল গার্লস প্রোগ্রামিং প্রতিযোগিতা ২০১৮ আয়োজন করতে যাচ্ছে । প্রথমবারের মত এইবার প্রাইমারী পর্যায়ের শিক্ষার্থীরা ন্যাশনাল গার্লস প্রোগ্রামিং প্রতিযোগিতা ২০১৮ তে অংশগ্রহন করতে পারবে। এবার ২টি পর্যায়ে প্রতিযোগিতা টি অনুষ্ঠিত হবে। ড্যাফোডিল ইন্টারন্যাশনাল ইউনিভার্সিটিতে ২২ ই অক্টোবর, ২০১৮ তারিখে অনুষ্ঠিত হবে চূড়ান্ত প্রতিযোগিতা। চূড়ান্ত পর্বের আগে ১৩ই সেপ্টেম্বর ২০১৮ তারিখে অনুষ্ঠিত হবে প্রিলিমিনারী পর্বের মক অনুষ্ঠিত হবে। এই পর্বটি সকল অংশগ্রহণকারী দলের জন্য খোলা থাকবে। \r<br />\r<br />\r<br />\r<br />এইবারের ন্যাশনাল গার্লস প্রোগ্রামিং কন্টেস্টটি দুইটি বিভাগে হবে।\r<br />\r<br />বিভাগ-১ঃ \r<br />এই বিভাগে প্রাথমিক বিদ্যালয়ের শিক্ষার্থীরা অংশগ্রহণ করতে পারবে।\r<br />প্রতিযোগিতাটি হবে স্ক্র্যাচে যা বিস্তারিতভাবে পরবর্তীতে জানিয়ে দেওয়া হবে।\r<br />\r<br />\r<br />বিভাগ-২ঃ \r<br />এই বিভাগে মাধ্যমিক, উচ্চমাধ্যমিক এবং বিশ্ববিদ্যালয় পর্যায়ের শিক্ষার্থীরা অংশগ্রহণ করতে পারবে। \r<br />এই বিভাগের প্রতিযোগিতাটি ACM ইন্টারন্যাশনাল কলেজিয়েট প্রোগ্রামিং কনটেস্ট (আইসিপিসি) এর নিয়ম অনুযায়ী অনুষ্ঠিত হবে।বর্তমান নিয়ম অনুযায়ী প্রতিটি দল তিনজন ছাত্রীর সমন্বয়ে গঠিত হবে। একটি দলের সবাইকে অবশ্যই একই শিক্ষাপ্রতিষ্ঠানের শিক্ষার্থী হতে হবে।\r<br />প্রতিযোগিতার ধাপ সমূহঃ\r<br />রেজিস্ট্রেশন ফর্ম পূরণের মাধ্যমে প্রিলীমিনারি কন্টেস্টের জন্য রেজিস্ট্রেশন সম্পন্ন করতে হবে।\r<br />প্রিলীমিনারি কন্টেস্টে উর্ত্তীর্ণ হওয়া টিম গুলো অনসাইট কন্টেস্টের জন্য রেজিস্ট্রেশন করতে পারবে এবং এর জন্য রেজিস্ট্রেশন ফি জমা দিতে হবে।\r<br />অনসাইট কন্টেস্টের জন্য সিলেক্ট হওয়া টিমগুলো ২২ই অক্টোব্র,২০১৮ তে কন্টেস্ট ভেন্যুতে উপস্থিত হয়ে মূল প্রতিযোগিতায় অংশগ্রহণ করতে পারবে।\r<br />\r<br />\r<br />মুল প্রতিযোগিতায় নির্বাচিত হওয়ার নিয়মাবলীঃ\r<br />প্রতিটি শিক্ষাপ্রতিষ্ঠান তাদের প্রিলিমিনারী কন্টেস্টের এর পার্ফরমেন্স অনুসারে শিক্ষাপ্রতিষ্ঠান অনুযায়ী স্লট পাবে।\r<br />মুল প্রতিযোগিতায় অংশগ্রহণের জন্য প্রতিটি টিমকে অন্তত একটি সমস্যার সমাধান করতে হবে।\r<br />মাধ্যমিক এবং উচ্চমাধ্যমিক শিক্ষাপ্রতিষ্ঠানের শিক্ষার্থীরা তাদের পারফর্মেন্স অনুযায়ী বিশেষ স্লট পাবে।\r<br />\r<br />\r<br />প্রতিযোগিতা সংক্রান্ত সময়সূচীঃ \r<br />রেজিস্ট্রেশন শুরুর তারিখঃ ১ আগস্ট , ২০১৮ \r<br />রেজিস্ট্রেশনের শেষ তারিখঃ ১১ সেপ্টম্বর, , ২০১৮\r<br />প্রিলিমিনারী মকঃ ১৩ সেপ্টেম্বর , ২০১৮\r<br />প্রিলিমিনারীঃ ১৪ সেপ্টেম্বর , ২০১৮\r<br />মূল প্রতিযোগিতাঃ ২২ অক্টোবর , ২০১৮\r<br />\r<br />\r<br />ভেন্যুঃ\r<br />ড্যাফোডিল ইন্টারন্যাশনাল ইউনিভার্সিটি,\r<br />৪/২, সোবহানবাগ, মিরপুর রোড, ধানমন্ডি, ঢাকা-১২০৭\r<br />\r<br />প্লাটফর্মঃ \r<br />CodeMarshal ( https://algo.codemarshal.org )\r<br />\r<br />রেজিস্ট্রেশন ফি (চূড়ান্ত প্রতিযোগিতায় অংশগ্রহণকারী টিমের জন্য ): \r<br />৪০০০/=( বিশ্ববিদ্যালয় পর্যায়ে) \r<br />প্রাইমারী পর্যায়ে কোনো রেজিস্ট্রেশন ফি নেই\r<br />\r<br />রেজিস্ট্রেশন লিংক:\r<br />https://goo.gl/P3bQBB\r<br />\r<br />আরো তথ্যের জন্য এখানে ক্লিক করুন:\r<br />https://ngpc.daffodilvarsity.edu.bd\r<br />\r<br />যোগাযোগের জন্যঃ\r<br />মেইলঃ ngpc2018@diu.edu.bd', 'n/a', 'event', 'yes', NULL, NULL),
(10, '11th convocation', '10th Convocation of AUST is going to be held on 09 January 2018 at Bangabandhu International Conference Centre, Sher-e-Bangla Nagar, Dhaka. All graduates of B.Sc. in Engineering (CE, CSE, EEE, IPE, ME and TT/TE), B. Arch, BBA, MBA, EMBA, M.Sc. (Math.) and M.Ed. programs of Spring 2016 and Fall 2016 semesters are advised to register their names by depositing Tk. 5,500.00 per person for participation in the Convocation within 24 December 2017.', 'www.btf-reg.org', 'convocation', 'no', NULL, NULL);

