CREATE TABLE `library_details` (
  `id` int(10) UNSIGNED NOT NULL,
  `detailsHead` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL,
