) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Dumping data for table `library_details`
--

INSERT INTO `library_details` (`id`, `detailsHead`, `description`, `created_at`, `updated_at`) VALUES
(1, 'About the Library', 'Ahsanullah University of Science and Technology(AUST) Library has grown over the years since 1992 and now is one of the best university libraries in Bangladesh. This is the first fully automated university library in the country using Bi-lingual Library Management System, developed by AUST Library, which supports MARC21, web-based online lending and receiving, browsing databases of books, a-v materials, journals, newspapers and magazines, searching full-text online books and journals, creating institutional repositories, tracking circulation system, maintain RFID self check and book drop records, auto email alert services etc. Its online databases provide full access to all users, facilitates navigation and reservation of books from distant work-stations through its own website http://library.northsouth.edu The users can also check their borrowing status, renew issued resources and can reserve three books at a time for 48 hours through the library website. This is the only university library in Bangladesh where the Library of Congress Classification System is being used to organize and arrange books, reports, journals and other resources.\r\n\r\nThe library has introduced state-of-the-art technology Radio Frequency Identification (RFID) Based Library Management System to automate library operation and management for the first time in the country in December 2012, financed by the World Bank and the University Grants Commission of Bangladesh under the Higher Education Quality Enhancement Project (HEQEP). Now, the library users themselves can issue and return books using Self-Check and Book-Drop machines. They can also track the books on shelves using tracking machines.\r\n\r\nThe library consists of six floors with over 70,000 sq.ft. area at the south-east side of the AUST campus at Tejgaon, Dhaka. It can accommodate over 1,400 students at a time in its well-furbished reading rooms. On an average 2,500 users use the library every day.', NULL, NULL),
(2, 'Resources', 'A total number of 51,008 printed books, reports and bound journals, 87,903 online e-books (access through INASP/PERI, UDL and Research4Life only), 64,624 online journals (access through 52 E-resource providers), 1,900 CD ROM books and databases, 229 DVDs and videos, 159 audio-cassettes and a good numbers of other resources of the library cover all branches of knowledge. In addition to these collections, the library subscribes print issues of 46 foreign and 19 local journals, 18 foreign and 22 local magazines, two foreign dailies and almost all leading national dailies of Bangladesh.\r\n\r\nThe AUST library is the pioneer of subscribing online journals and MyAthens in the country. It started subscription to online journals with JSTOR, IEEE, ACM Digital library and 39 titles of online journals in various disciplines for the first time in 2002. After that the other libraries started subscription to online journals in Bangladesh. It has also started subscription to e-resource databases, namely, EconLit, AHEAD and Global Development Finance in 1998.\r\n\r\nAll registered members of AUST library get access to online journals and e-books databases from inside and outside campus through Internet.\r\n\r\nInstitutional Repository', NULL, NULL),
(3, 'Cyber and Audio-Visual Center', 'It maintains a cyber and audio-visual center equipped with 50 brand computers with Wi-Fi and broadband Internet connection. In addition to this, the library is donned with 30 computers in its various floors to use online resources for supporting courses. All students, faculty members and staff members of the university can browse, download and print materials from these computers. The audio visual unit is also equipped with TV, VCD, VCR, DVD, multi-media projector and other audio-visual equipments.', NULL, NULL),
(4, 'Sections', 'At present, the library maintains 12 different sections, namely, arts and social sciences, applied sciences and engineering, bio-medical sciences, reference, periodicals, cyber & audio-visuals, newspaper archive, study hall, faculty corner, Chinese books, acquisition & processing, and library administration to provide better services to its users.', NULL, NULL),
(5, 'Services', 'Currently, the library provides lending, reference, readers\' guidance, internet, reading, news clipping, database searching and printing, CD writing, audio-visual, current awareness, SDI and reprography services to its users. The Wi-Fi and broadband internet connection of the library building help the library users to access online resources easily.', NULL, NULL),
(6, 'Service Hours', 'AUST library maintains 7 days a working week. It is open, Sunday through Thursday, from 8:00 a.m. to 9:30 p.m. and from 10:00 a.m. to 9:00 p.m. on Saturday. On Friday, it is open from 10:00 a.m. to 6:00 p.m. with a Jumma prayer break from 1:00 p.m. to 2:30 p.m. and maintains single shift from 9:00 a.m. to 5:00 p.m. during the semester break. It remains closed on public holidays and other dates announced by the university authorities.', NULL, NULL);

